import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
  let [currPage, setPage] = React.useState('home')
  if(currPage == 'home'){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
  else if (currPage == 'addtocapsule'){
    return (
      <div>
        You will add to the capsule here.
      </div>
    );
  }
  else if (currPage == 'deletefromcapsule'){
    return (
      <div>
        You will remove from the capsule here.
      </div>
    );
  }
  else if (currPage == 'visualizecapsule'){
    return (
      <div>
        The tabloo will be here.
      </div>
    );
  }
  else{
    return (
      <div>
        refresh page if here
      </div>
    );
  }
}

export default App;
